   let x = fajl.slike[props.linkovi].linkovi.map(x=> <img src={x} alt='Slika prirodnog kamena'/>);
   
   console.log(x);
   return(
      <div className="Nesto">
         <p>{props.children}</p>
         <div className="kanticar">
            {x}   
         </div>

      </div>
   )
}
